    false,nt"url": null,nt"notes": "These data inform the public of the most
    recent stock status for all stocks (FSSI and non-FSSI) in the fishery management
    unit contained in a fishery managment plan.  Stock status includes overfishing,
    overfished, and approaching overfished condition; for FSSI stocks B/Bmsy estimates
    and FSSI score are also included.  Files are in PDF format and are posted quarterly
    on the Office of Sustainable Fisheries website.  The FSSI is a performance measure
    for the sustainability of US fish stocks selected for their importance to commercial
    and recreational fisheries, and their ability to be assessed.  The FSSI will increase
    as stock status becomes known, overfishing has ended, and stocks increase to a level
    that provides maximum sustainable yield.  B/Bmsy is a measure of current stock biomass
    relative to the target biomass level (the biomass that produces maximum sustainable
    yield, or MSY).  FSSI scores are updated quarterly and are available from 2005 to
    present.  Data are derived from data entered in the Species Informaiton System (SIS)
    database, maintained by the Office of Science and Technology.",nt"license_title":
